import React, { useState } from 'react';
import axios from 'axios';
import ImportCSV from './components/ImportCSV';
import MLdropdown from './components/MLdropdown';
import NextButton from './components/NextButton';
import ProgressBar from './components/ProgressBar';

function App() {
  const [currentStep, setCurrentStep] = useState(0);
  const steps = ['Data','ML Model', 'Results', 'Dependency Graphs','ROI Analysis'];
  const pages = [ImportCSV, MLdropdown];

  const handleNext = () => {
    if (currentStep < steps.length - 1) {
      setCurrentStep(currentStep + 1);
    }
  };

  const CurrentPage = pages[currentStep];

  const [graphFile, setGraphFile] = useState(null);
  const [countFile, setCountFile] = useState(null);
  const [graphUrl, setGraphUrl] = useState(null);
  const [graphRowCount, setGraphRowCount] = useState(null);
  const [graphColumnCount, setGraphColumnCount] = useState(null);
  const [countRowCount, setCountRowCount] = useState(null);
  const [countColumnCount, setCountColumnCount] = useState(null);

  const handleGraphFileUpload = (event) => {
    setGraphFile(event.target.files[0]);
  };

  const handleCountFileUpload = (event) => {
    setCountFile(event.target.files[0]);
  };

  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', graphFile);

    axios.post('/upload/graph', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setGraphUrl(response.data.graph_url);
          setGraphRowCount(response.data.rows);
          setGraphColumnCount(response.data.columns);
        }
      })
      .catch((error) => {
        console.error(error);
        // Handle error if necessary
      });
  };

  const handleCountUpload = () => {
    const formData = new FormData();
    formData.append('file', countFile);

    axios.post('/upload/count', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setCountRowCount(response.data.rows);
          setCountColumnCount(response.data.columns);
        }
      })
      .catch((error) => {
        console.error(error);
        // Handle error if necessary
      });
  };

  return (

    <div className="container">
       <div className="App">
          <header className="App-header">

          <div className="app-container">
            <ProgressBar steps={steps} currentStep={currentStep} onNext={handleNext} />

          </div>

          </header>
          <div className="App-content">
          {CurrentPage && <CurrentPage />}
          </div>

        </div>
      <div className="section">
        <h2>Upload CSV for Graph</h2>
        <input type="file" onChange={handleGraphFileUpload} />
        <button onClick={handleGraphUpload}>Upload</button>

        {graphUrl && (
          <div className="result">
            <img src={graphUrl} alt="Graph" />
            <p>Graph Rows: {graphRowCount}</p>
            <p>Graph Columns: {graphColumnCount}</p>
          </div>
        )}
      </div>

      <div className="section">
        <h2>Upload CSV for Row/Column Count</h2>
        <input type="file" onChange={handleCountFileUpload} />
        <button onClick={handleCountUpload}>Get Count</button>

        {countRowCount !== null && countColumnCount !== null && (
          <div className="result">
            <p>Count Rows: {countRowCount}</p>
            <p>Count Columns: {countColumnCount}</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
